import React, { Fragment } from "react";
import { Link } from 'react-router-dom';
import { Col } from '../Grid';
import './Nav.css';

const Nav = (props) => {
  let greeting;

  if (props.user === null) {
		greeting = <p>Hello guest</p>
	};

  return (
    <div className='container-fluid'>
    <nav className="navbar">
      <div className='container-fluid'>
      <Col size="md-6 sm-6">
        <div to="/" className="navbar-brand">CryptoFam</div>
      </Col>
      <Col size="md-6 sm-6">
        <div className="float-right">
        {greeting} -
        </div>
      </Col>
      </div>

    </nav>
    </div>

  )
};

export default Nav;
